<Link to="/">

		<div className="card">
		<div className="card-body">
		TItle

		</div>
		</div>
		</Link>
		</div>
	)
}
const CourseList = props => {
	return (
		<div>
			{props.courses.map(course => (
				<Course key={course.title} course={course}/>
			))}
		</div>
	)
}
